INSERT INTO `materiguru` VALUES (22,'sdgw','2024-01-23 00:00:00','Komputer','','Materi','Fransiskus Hutagalung','',NULL,NULL,'isyhwr',NULL,NULL),(26,'jumg','2024-01-23 00:00:00','Belajar gorm','1. **Instalasi Go-pg:**\n\n```\ngo get -u github.com/go-pg/pg/v10\n```\n\n2. **Buat database PostgreSQL:**\n\nBuat database PostgreSQL baru untuk digunakan dengan aplikasi Go-pg. Anda dapat melakukannya menggunakan perintah berikut:\n\n```\ncreatedb my_app\n```\n\n3. **Buat model Go-pg:**\n\nBuat model Go-pg untuk mewakili data yang akan Anda simpan dalam database PostgreSQL. Model Go-pg adalah struct yang berisi bidang yang sesuai dengan kolom dalam tabel database.\n\nMisalnya, jika Anda memiliki tabel bernama `users` dengan kolom `id`, `name`, dan `email`, Anda dapat membuat model Go-pg sebagai berikut:\n\n```go\npackage models\n\nimport \"github.com/go-pg/pg/v10/orm\"\n\ntype User struct {\n    ID    int64  `pg:\"id,pk\"`\n    Name  string `pg:\"name\"`\n    Email string `pg:\"email\"`\n}\n```\n\n4. **Buat koneksi ke database PostgreSQL:**\n\nBuat koneksi ke database PostgreSQL menggunakan Go-pg. Anda dapat melakukannya dengan menggunakan fungsi `pg.Connect()`.\n\n```go\npackage main\n\nimport (\n    \"github.com/go-pg/pg/v10\"\n    \"github.com/go-pg/pg/v10/orm\"\n    models \"your_project/models\"\n)\n\nfunc main() {\n    db := pg.Connect(&pg.Options{\n        User:     \"postgres\",\n        Password: \"password\",\n        Database: \"my_app\",\n    })\n\n    defer db.Close()\n\n    // Buat tabel pengguna jika belum ada\n    err := db.CreateTable(&models.User{}, &orm.CreateTableOptions{\n        IfNotExists: true,\n    })\n    if err != nil {\n        panic(err)\n    }\n\n    // Masukkan beberapa data ke dalam tabel pengguna\n    user1 := &models.User{\n        Name:  \"John Doe\",\n        Email: \"john.doe@example.com\",\n    }\n\n    _, err = db.Model(user1).Insert()\n    if err != nil {\n        panic(err)\n    }\n\n    // Ambil data dari tabel pengguna\n    users := []*models.User{}\n\n    err = db.Model(&users).Select()\n    if err != nil {\n        panic(err)\n    }\n\n    for _, user := range users {\n        fmt.Printf(\"%d %s %s\n\", user.ID, user.Name, user.Email)\n    }\n}\n```\n\n5. **Jalankan aplikasi Go-pg:**\n\nJalankan aplikasi Go-pg dengan menggunakan perintah `go run main.go`.\n\nAplikasi Go-pg akan membuat tabel `users` dalam database PostgreSQL dan memasukkan beberapa data ke dalamnya. Kemudian, aplikasi akan mengambil data dari tabel `users` dan mencetaknya ke konsol.','Materi','Fransiskus Hutagalung','',NULL,NULL,'igcbwj',NULL,NULL);
